export async function getProducts() {
  try {
    const response = await fetch('http://localhost:porta/products');
    if (!response.ok) {
      throw new Error('Erro ao buscar produtos');
    }
    return response.json();
  } catch (error) {
    console.error(error);
    throw error;
  }
}
